import React from "react";
import { Route, Routes, Switch } from "react-router-dom";
import Home from "./Home";

const AppRoutes = () => {
    return (
        <div>
            <Switch>
                <Route path="/">{<Home />}</Route>
            </Switch>
        </div>
    );
};

export default AppRoutes;
